import Get from './Get'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Patch from './Patch'
import './App.css';
import Form from './Form'
import Delete from './Delete'

function App() {
  return (
    <div>
      <h1>Welcome to the Teacher Data</h1>
      <Router>
        <Routes>
          <Route path="/" component={<Form />} />
          <Route path="/teacher/:id" component={<Get />} />
          <Route path="/teacher/edit/:id" component={<Patch />} />
          <Route path="/teacher/Delete" component={<Delete />} />
        </Routes>
      </Router>



    </div>
  );
}

export default App;
